import Nav from "../Nav/Nav";
import "./Header.css";
import logo from "../../../src/Assets/Images/logo.png"

function Header(): JSX.Element {
    return (
        <div className="Header">

        <img id="logo" src={logo}/>
        <Nav/>
         </div>
    );
}

export default Header;
